+ (void)drawSunTwoWithFrame: (CGRect)frame sunRotation: (CGFloat)sunRotation scale: (CGFloat)scale
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* orange = [UIColor colorWithRed: 0.982 green: 0.724 blue: 0.062 alpha: 1];
    UIColor* color4 = [UIColor colorWithRed: 1 green: 0.832 blue: 0.396 alpha: 1];

    //// Sun Group
    {
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, CGRectGetMaxX(frame) - 100, CGRectGetMinY(frame) + 100);
        CGContextRotateCTM(context, -sunRotation * M_PI / 180);
        CGContextScaleCTM(context, scale, scale);



        //// Star Drawing
        UIBezierPath* starPath = UIBezierPath.bezierPath;
        [starPath moveToPoint: CGPointMake(0, -100)];
        [starPath addLineToPoint: CGPointMake(12.43, -34.14)];
        [starPath addLineToPoint: CGPointMake(64.28, -76.6)];
        [starPath addLineToPoint: CGPointMake(31.47, -18.17)];
        [starPath addLineToPoint: CGPointMake(98.48, -17.36)];
        [starPath addLineToPoint: CGPointMake(35.78, 6.31)];
        [starPath addLineToPoint: CGPointMake(86.6, 50)];
        [starPath addLineToPoint: CGPointMake(23.35, 27.83)];
        [starPath addLineToPoint: CGPointMake(34.2, 93.97)];
        [starPath addLineToPoint: CGPointMake(0, 36.33)];
        [starPath addLineToPoint: CGPointMake(-34.2, 93.97)];
