        [starPath addLineToPoint: CGPointMake(-98.48, -17.36)];
        [starPath addLineToPoint: CGPointMake(-31.47, -18.17)];
        [starPath addLineToPoint: CGPointMake(-64.28, -76.6)];
        [starPath addLineToPoint: CGPointMake(-12.43, -34.14)];
        [starPath closePath];
        [orange setFill];
        [starPath fill];


        //// Oval Drawing
        UIBezierPath* ovalPath = [UIBezierPath bezierPathWithOvalInRect: CGRectMake(-55, -55, 110, 110)];
